import React from 'react'


const Personajes = ({personaje = []}) =>{
return(

<div className='row' >
                  { personaje.map(({item, index}) =>{
                       <div key={index} className='col'>
                          <div className='card'>
                              <img src={item.image} alt="" />
                          </div>

                      </div>
                  })

                  }
                  
      
    </div>
)
}

export default Personajes
